import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
import './snake.css'
let mat=[]
let count=0
let refs=[]
for(let i=0;i<40;i++)
{
  let t=[]
    let temp=[]
    for(let j=0;j<75;j++)
    {t.push(null);temp.push(0);}
    mat.push(temp)
    refs.push(t);
}

refs=JSON.parse(JSON.stringify(mat))
class Board extends React.Component{
    render()
    {
        return(
            <div className='Board'>
               {mat.map((mat)=><Row mat={mat}/>)}
               <Button style={{display:'block'}}/>
            </div>
        )
    }
}
class Row extends React.Component{
    constructor(props)
    {
        super(props)
    }
    render(){
        return(
            <div className='Row'>
            {this.props.mat.map((ele)=><Element />)}
            </div>
        )
    }
}
