            </div>
        )
    }
}
class Button extends React.Component{
  render(){
    return(
      <div>
        <button>up</button>
        <button>right</button>
        <button>down</button>
        <button>left</button>
      </div>
    )
  }
}
let r=document.getElementById('root')
ReactDOM.render(<Board/>,r)
let queue=[]
function util(row,col)
{
  if(col>=75)return;
  setTimeout(()=>{
    r.childNodes[0].childNodes[row].childNodes[col].style.backgroundColor="black";
    if(queue.length==7)
    {
      let t=queue.shift()
      r.childNodes[0].childNodes[t[0]].childNodes[t[1]].style.backgroundColor="white";
    }
    queue.push([row,col]);
    util(row,(col+1)%75);
  },100)
}

